package me.yumin.compressor.test;

import me.yumin.compressor.lzf.SpeedLZF;

/**
 * @author yumin
 * 
 */
public class SpeedLZFTest {

	/**
	 * 
	 * @param args
	 */
	public static void main(String[] args) {

//		System.out.println(compare("abcde"));
		System.out.println(compare("abcdeabcdeabcde999"));
//		System.out.println(compare("abcdeabcdeabcdeabcdeabcdeabcdeabcdeabcdeabcdeabcdeabcdeabcdeabcdeabcdeabcdeabcdeabcdeabcdeabcdeabcde"));
//		System.out.println(compare(""));
//		System.out.println(compare(""));
//		System.out.println(compare(""));
	}

	/**
	 * 
	 * @param source
	 * @return
	 */
	private static boolean compare(String source) {

		boolean result = false;

		byte[] compress = SpeedLZF.compress(source.getBytes());
		byte[] expand = SpeedLZF.uncompress(compress);

		if (source.equalsIgnoreCase(new String(expand).toString())) {
			result = true;
		}

		return result;
	}

}
